func emojiSplit(s string, n int) [][]string {
	if n == 0 {
		return [][]string{{s, ""}}
	}

	matches := EmojiRe.FindAllStringIndex(s, n)
	strings := make([][]string, 0, len(matches))

	beg := 0
	end := 0
	for _, match := range matches {
		if n > 0 && len(strings) >= n-1 {
			break
		}

		end = match[0]
		if match[1] != 0 {
			strings = append(strings, []string{s[beg:end], ""})
			strings = append(strings, []string{s[match[0]:match[1]], "emoji"})
		}
		beg = match[1]
	}

	if end != len(s) {
		strings = append(strings, []string{s[beg:], ""})
	}

	return strings
}

func StrSplit(reqStr string) []string {
	var res []string
	if len(reqStr) == 0 {
		return res
	}
	strArr := emojiSplit(reqStr, -1)
	for _, str := range strArr {
		if str[1] == "emoji" {
			res = append(res, str[0])
			continue
		}
		res = append(res, splitter.Split(str[0])...)
	}
	return res
}

func IsEmoji(text string) bool {
	if len(text) == 0 {
		return false
	}
	if _, ok := emojiMap[text]; ok {
		return true
	}
	return false
}

func GetEmojiImage(text string) (image.Image, bool) {
	if len(text) == 0 {
		return nil, false
	}
	if fileName, ok := emojiMap[text]; ok {
		file, err := emojiPng.ReadFile(fmt.Sprintf("emoji/%s.png", fileName))
		if err != nil {
			return nil, false
		}
		if decode, _, err := image.Decode(bytes.NewBuffer(file)); err == nil {
			return decode, true
		}
	}
	return nil, false
}
